function ActivateCountDown(n,t){if(_countDowncontainer=document.getElementById(n),!_countDowncontainer){alert("count down error: container does not exist: "+n+"\nmake sure html element with this ID exists");return}SetCountdownText(t);window.setTimeout("CountDownTick()",1e3)}function CountDownTick(){var t,n,i,r;if(_currentSeconds<=0){t=$("<div />");t.addClass("modal_black");$("body").append(t);n=$(".timeout");n.show();i=Math.max($(window).height()/2-n[0].offsetHeight/2,0);r=Math.max($(window).width()/2-n[0].offsetWidth/2,0);n.css({top:i,left:r});return}SetCountdownText(_currentSeconds-1);window.setTimeout("CountDownTick()",1e3)}function SetCountdownText(n){var t,i;_currentSeconds=n;t=parseInt(n/60);n=n%60;t=t%60;i=AddZero(t)+":"+AddZero(n);_countDowncontainer.innerHTML=i}function AddZero(n){return n>=0&&n<10?"0"+n:n+""}function SetCountDownTime(n){_currentSeconds=n}$(document).ajaxSend(function(){ShowProgress()});$(document).ajaxStop(function(){HideProgress()});var _countDowncontainer=0,_currentSeconds=0;$(document).ajaxComplete(function(){var n=$("#SessionTimeout").val();SetCountdownText(n)});